import image_navbar from '../../assents/images/image.svg';
import image_filme from '../../assents/images/image_filme.svg';
import './Navbar.css';
import { Link } from 'react-router-dom';

export default function Navbar({films}) {

    if(films){
        return (
            <div>

            <div className="conteudo"> 
                <img src={image_filme}/>
                <div>
                        <h1 className="filme">
                            {films.title}
                        </h1>
                </div>
            </div>
            <Link to={`/`}>back</Link>
            </div>
        );

    }else{
        return (
            <div className="conteudo"> 
                <img src={image_navbar}/>
                <div>
                        <h1>
                            Star Wars movies
                        </h1>
                        <form>
                            <div class="input-field">
                            <input id="search" type="search" required/>
                            <label class="label-icon" for="search"><i class="material-icons">search</i></label>
                            <i class="material-icons">close</i>
                            </div>
                        </form>
                </div>
            </div>
        );

        }
};
